import React from "react";
import './Todo.css';
import Button from "../components/Button";


const Todo = (props) =>{
    return (
       
            <li className="todo_item">
                <div className="todo_wrapper">
            <input type="checbox" />
            <p>{props.todo.text}</p>
            </div>
            <Button text ="Удалить Todo"/>
        </li>
    )}
     
    


export default Todo;
